PO.Data:
@SQL=(SELECT FTU_MaintWorkOrder.CT_Component_ID FROM FTU_MaintWorkOrder
JOIN FTU_MaintWOResult ON (FTU_MaintWorkOrder.FTU_MaintWorkOrder_ID = FTU_MaintWOResult.FTU_MaintWorkOrder_ID)
JOIN FTU_MaintWOResultLine ON (FTU_MaintWOResult.FTU_MaintWOResult_ID = @FTU_MaintWOResult_ID@)

